import classes from "./AddUser.module.css";
const AddUser = () => {
  return (
    <div>
      <label>Username</label>
      <input className={classes.input} type="text" />
      <label>Age (Years)</label>
      <input type="number" />
    </div>
  );
};
export default AddUser;
